import { useEffect, useState } from "react";
import Map from "../components/Map/Map";
function Vaccination() {
  const [loading, SetLoading] = useState(true);

  useEffect(() => {
    SetLoading(false);
  }, []);
  return <div>{loading ? <h1>...loading</h1> : <Map />}</div>;
}
export default Vaccination;
